import React from "react";

function WindowWithForm() {
  return (
    <div className="window">
      <h2 className="window__title">Регистрация</h2>
      <form className="window__form">
        <input className="window__form-item" type="email" name="email" placeholder="Email" />
        <input className="window__form-item" type="text" name="text" placeholder="Пароль" />
      </form>
      <button className="window__button">Зарегистрироваться</button>
      <p className="login__text">Уже зарегистрированы? <Link to="/sign-in" className="login__link">Войти</Link> </p>
    </div>
  );
}

export default WindowWithForm;
